(68, 'http://www.24h.com.vn/nha-dep-c792.html', 'Nhà đẹp - Những mẫu nhà, thiết kế nhà mới hợp xu hướng nhất', 'Nha dep - Tổng hợp các mẫu nhà đẹp mới nhất 2018. Các thiết kế nhà, biệt thự theo nhiều phong cách tại Việt Nam và trên thế giới. Tư vấn trang trí nội thất cho ngôi nhà của bạn.', '7779b69a4fe2c5b50de1baa365dadf2b', '2018-01-25 02:01:18', '2018-01-25 02:01:18', 'Nha dep - Nhung mau nha, thiet ke nha moi hop xu huong nhat', 'Nha dep - Tong hop cac mau nha dep moi nhat 2018. Cac thiet ke nha, biet thu theo nhieu phong cach tai Viet Nam va tren the gioi. Tu van trang tri noi that cho ngoi nha cua ban.'),
