(71, 'http://www.24h.com.vn/phim-chieu-rap-c285.html', 'Phim chieu rap : Xem Phim Chiếu Rạp mới nhất', 'Phim chiếu rạp - Những bộ Phim Chiếu Rạp bom tấn vừa ra mắt hấp dẫn & lôi cuốn nhất năm Việt Nam & Nước Ngoài chỉ có tại Phim Hay 24H', '4af997a0290a3ec64da454f7137c0a67', '2018-01-25 02:01:21', '2018-01-25 02:01:21', 'Phim chieu rap : Xem Phim Chieu Rap moi nhat', 'Phim chieu rap - Nhung bo Phim Chieu Rap bom tan vua ra mat hap dan & loi cuon nhat nam Viet Nam & Nuoc Ngoai chi co tai Phim Hay 24H'),
(72, 'http://www.24h.com.vn/tong-hop-video.html', 'Video tổng hợp sự kiện hay nhất, nóng nhất trong tuần', 'Tổng hợp các video clip thể thao, bóng đá, tin tức nóng nhất tuần qua. Xem video giải trí hay tại 24h.com.vn.', '059bf5473eb89fc3dd296e8f0a70ad93', '2018-01-25 02:01:21', '2018-01-25 02:01:21', 'Video tong hop su kien hay nhat, nong nhat trong tuan', 'Tong hop cac video clip the thao, bong da, tin tuc nong nhat tuan qua. Xem video giai tri hay tai 24h.com.vn.'),
(73, 'http://www.24h.com.vn/lich-thi-dau-bong-da-c287.html', 'Lịch thi đấu Bóng Đá Anh, Ý TBN C1, Kết quả Tỉ lệ cược 24h', 'Lich thi dau bong da anh, bong da viet nam, cup C1, kết quả, tỷ lệ cược, lịch thi đấu ngoại hạng Anh 2018, bong da y, bong da tay ban nha. Lịch bóng đá anh, ý, c1, TBN, việt nam.', 'fc441ca4fea2d6a0e61ee2b470022412', '2018-01-25 02:01:22', '2018-01-25 02:01:22', 'Lich thi dau Bong da Anh, y TBN C1, Ket qua Ti le cuoc 24h', 'Lich thi dau bong da anh, bong da viet nam, cup C1, ket qua, ty le cuoc, lich thi dau ngoai hang Anh 2018, bong da y, bong da tay ban nha. Lich bong da anh, y, c1, TBN, viet nam.'),
(74, 'http://www.24h.com.vn/lam-dep-c145.html', 'Làm Đẹp - Chia sẻ bí quyết làm đẹp hiệu quả mỗi ngày', 'Tư vấn các bí quyết làm đẹp da, đẹp dáng tự nhiên, hiệu quả và an toàn nhất. Bí quyết chọn và dùng mĩ phẩm, cách trang điểm, trị mụn... tại Làm đẹp 24h.', 'ac42b911e98b2c84506263a413a6c8cb', '2018-01-25 02:01:22', '2018-01-25 02:01:22', 'Lam dep - Chia se bi quyet lam dep hieu qua moi ngay', 'Tu van cac bi quyet lam dep da, dep dang tu nhien, hieu qua va an toan nhat. Bi quyet chon va dung mi pham, cach trang diem, tri mun... tai Lam dep 24h.'),
(75, 'http://www.24h.com.vn/cham-soc-da-c236.html', 'Chăm sóc da tại nhà đơn giản và hiệu quả nhất', 'Chia sẻ các cách chăm sóc da với những nguyên liệu tự nhiên cực kỳ dễ kiếm. Cách chăm sóc các loại da an toàn và hiệu quả: Da nhờn, da khô, da mụn...', '60848df32d69ae0e3e5c42b861690148', '2018-01-25 02:01:23', '2018-01-25 02:01:23', 'Cham soc da tai nha don gian va hieu qua nhat', 'Chia se cac cach cham soc da voi nhung nguyen lieu tu nhien cuc ky de kiem. Cach cham soc cac loai da an toan va hieu qua: Da nhon, da kho, da mun...'),
(76, 'http://www.24h.com.vn/trang-diem-c146.html', 'Trang điểm: Hướng dẫn cách trang điểm đẹp mỗi ngày', 'Trang diem - Chia sẻ cách trang điểm đơn giản giúp bạn đẹp nhẹ nhàng. Cách trang điểm đẹp tự nhiên, trang điểm kiểu Hàn Quốc cực HOT.', '9278742eb07007dca1b451b1119e2b2d', '2018-01-25 02:01:23', '2018-01-25 02:01:23', 'Trang diem: Huong dan cach trang diem dep moi ngay', 'Trang diem - Chia se cach trang diem don gian giup ban dep nhe nhang. Cach trang diem dep tu nhien, trang diem kieu Han Quoc cuc HOT.'),
(77, 'http://www.24h.com.vn/giam-can-c147.html', 'Cách giảm cân nhanh và hiệu quả nhất tại nhà', 'Hướng dẫn các cách giảm cân nhanh nhất trong vòng 1 tuần. Chia sẻ các bí quyết làm giảm cân an toàn và có hiệu quả rất cao.', '24a271033007276f7ba16ad09f1de747', '2018-01-25 02:01:24', '2018-01-25 02:01:24', 'Cach giam can nhanh va hieu qua nhat tai nha', 'Huong dan cac cach giam can nhanh nhat trong vong 1 tuan. Chia se cac bi quyet lam giam can an toan va co hieu qua rat cao.'),
(78, 'http://www.24h.com.vn/tin-anh-nguoi-mau-thoi-trang-c78e448.html', 'Ảnh đẹp: Tin ảnh người mẫu thời trang HOT nhất', 'Tin ảnh người mẫu đẹp Hot nhất - Xem hình ảnh đẹp, mới nhất của người mẫu, ngôi sao 2018. Bộ sưu tập ảnh bikini khoe ngực nóng bỏng, Sexy của gái xinh, hot girl', '9427f7810a49b2d0330c22814424bda1', '2018-01-25 02:01:24', '2018-01-25 02:01:24', 'anh dep: Tin anh nguoi mau thoi trang HOT nhat', 'Tin anh nguoi mau dep Hot nhat - Xem hinh anh dep, moi nhat cua nguoi mau, ngoi sao 2018. Bo suu tap anh bikini khoe nguc nong bong, Sexy cua gai xinh, hot girl'),
(79, 'http://www.24h.com.vn/thi-truong-tieu-dung-c52.html', 'Thi truong – tieu dung, tin tuc kinh te, gia vang, thue, nha dat', 'Cập nhật tin tức về thị trường hàng ngày; biến động giá cả các mặt hàng tiêu dùng, giá vàng; tình hình biến động TT nhà đất, đầu tư, chính sách thuế, XNK', 'e67bc4819de580070ba1c7ee998c6f35', '2018-01-25 02:01:25', '2018-01-25 02:01:25', 'Thi truong – tieu dung, tin tuc kinh te, gia vang, thue, nha dat', 'Cap nhat tin tuc ve thi truong hang ngay; bien dong gia ca cac mat hang tieu dung, gia vang; tinh hinh bien dong TT nha dat, dau tu, chinh sach thue, XNK'),
(80, 'http://www.24h.com.vn/gia-ca-c340.html', 'Giá cả thị trường 24h | Cập nhật gia ca thi truong hom nay', 'Giá cả thị trường 24h: gia ca thi truong trong nước và thế giới, giá cả thị trường xe máy, điện thoại, lap top, hàng nông sản. CẬP NHẬP THÔNG TIN 24/7', 'b6ecdb3f04b194f42d446cab4efe9b61', '2018-01-25 02:01:25', '2018-01-25 02:01:25', 'Gia ca thi truong 24h | Cap nhat gia ca thi truong hom nay', 'Gia ca thi truong 24h: gia ca thi truong trong nuoc va the gioi, gia ca thi truong xe may, dien thoai, lap top, hang nong san. CaP NHaP THoNG TIN 24/7'),
(81, 'http://www.24h.com.vn/thi-truong-24h-c341.html', 'Khuyen Mai |Sản Phẩm, Chương trình khuyến mãi HOT Nhất', 'Khuyen mai - Cập nhật thông tin những chương trình khuyến mãi ưu đãi cực khủng, giờ vàng. Các sản phẩm khuyến mãi: điện thoại, máy tính, đồ dùng', 'ab977a0b0c350290a61fd4e6eca8ea2d', '2018-01-25 02:01:27', '2018-01-25 02:01:27', 'Khuyen Mai |San Pham, Chuong trinh khuyen mai HOT Nhat', 'Khuyen mai - Cap nhat thong tin nhung chuong trinh khuyen mai uu dai cuc khung, gio vang. Cac san pham khuyen mai: dien thoai, may tinh, do dung'),
(82, 'http://www.24h.com.vn/gia-xe-o-to-c747e4726.html', 'Giá xe ô tô: Cập nhật mới nhất giá xe ô tô tại Việt Nam và Thế giới', 'Giá xe ô tô - Giá xe, cập nhật các mức thuế, phí dành cho người mua xe hơi được cập nhật mới nhất. Giác các loại xe hơi tại Việt Nam và thế giới', 'b03a8f29772a167194bced86b599e112', '2018-01-25 02:01:28', '2018-01-25 02:01:28', 'Gia xe o to: Cap nhat moi nhat gia xe o to tai Viet Nam va The gioi', 'Gia xe o to - Gia xe, cap nhat cac muc thue, phi danh cho nguoi mua xe hoi duoc cap nhat moi nhat. Giac cac loai xe hoi tai Viet Nam va the gioi'),
(83, 'http://www.24h.com.vn/xe-may-xe-dap-c748.html', 'Xe máy - Tin tức xe máy, xe ga, xe số - Giá xe mô tô', 'Xe may - Tin tức, hình ảnh các mẫu xe máy Yamaha Honda Exciter Jupiter... mới ra mắt HOT nhất thị trường Việt Nam. Đánh giá xe máy độ, mô tô khủng.', '4a0981530f7364de2415f0642a16bbcb', '2018-01-25 02:01:28', '2018-01-25 02:01:28', 'Xe may - Tin tuc xe may, xe ga, xe so - Gia xe mo to', 'Xe may - Tin tuc, hinh anh cac mau xe may Yamaha Honda Exciter Jupiter... moi ra mat HOT nhat thi truong Viet Nam. danh gia xe may do, mo to khung.'),
(84, 'http://www.24h.com.vn/xe-phan-khoi-lon-c784.html', 'Xe phân khối lớn: Cập nhật các loại xe mô tô PKL mới ra mắt', 'Xe phân khối lớn - Tin tức mới nhất, cập nhật các mẫu mô tô phân khối lớn được ra mắt tại thị trường Việt Nam và trên Thế giới. Ducati, Kawasaki, BMW,...', '7b1117de6d144f70f7c0ab1287044fa6', '2018-01-25 02:01:29', '2018-01-25 02:01:29', 'Xe phan khoi lon: Cap nhat cac loai xe mo to PKL moi ra mat', 'Xe phan khoi lon - Tin tuc moi nhat, cap nhat cac mau mo to phan khoi lon duoc ra mat tai thi truong Viet Nam va tren The gioi. Ducati, Kawasaki, BMW,...'),
(85, 'http://www.24h.com.vn/xe-tay-ga-c783.html', 'Xe tay ga: Bảng giá, top những xe ga đẹp và đáng mua nhất 2018', 'Xe tay ga - Cập nhật những mẫu xe ga tốt nhất hiện nay của các hãng Yamaha, Honda, Suzuki, SYM, Piaggio. Giá xe tay ga, review mẫu xe ga mới và chi tiết nhất.', '555c7adfb9848d8c8d99b0aba2287700', '2018-01-25 02:01:29', '2018-01-25 02:01:29', 'Xe tay ga: Bang gia, top nhung xe ga dep va dang mua nhat 2018', 'Xe tay ga - Cap nhat nhung mau xe ga tot nhat hien nay cua cac hang Yamaha, Honda, Suzuki, SYM, Piaggio. Gia xe tay ga, review mau xe ga moi va chi tiet nhat.'),
(86, 'http://www.24h.com.vn/bang-gia-xe-c794.html', 'Bảng giá các mẫu xe máy cập nhật mới nhất hôm nay', 'Cập nhật bảng giá xe của các hãng xe lớn Honda, Yamaha, SYM... Chi tiết bảng giá theo từng tháng, cập nhật liên tục nhanh nhất tại 24h.', '58c580a42556f525e5dca2ebee6ac029', '2018-01-25 02:01:30', '2018-01-25 02:01:30', 'Bang gia cac mau xe may cap nhat moi nhat hom nay', 'Cap nhat bang gia xe cua cac hang xe lon Honda, Yamaha, SYM... Chi tiet bang gia theo tung thang, cap nhat lien tuc nhanh nhat tai 24h.'),
(87, 'http://www.24h.com.vn/vespa-c747e3089.html', 'Xe Vespa: Tin tức, Hình ảnh, giá xe Vespa mới nhất', 'Xe Vespa  - Tin tức hình ảnh, giá các dòng xe tay ga Vespa mới nhất hiện nay ở Việt Nam: Vespa cổ, Vespa LX, GT, PX, Sprint 3V i.e....', '4339889709f1aa4c93fffb08c100134a', '2018-01-25 02:01:30', '2018-01-25 02:01:30', 'Xe Vespa: Tin tuc, Hinh anh, gia xe Vespa moi nhat', 'Xe Vespa  - Tin tuc hinh anh, gia cac dong xe tay ga Vespa moi nhat hien nay o Viet Nam: Vespa co, Vespa LX, GT, PX, Sprint 3V i.e....'),
(88, 'http://www.24h.com.vn/o-to-c747.html', 'Ôtô - Tin tức, hình ảnh các mẫu xe hơi mới nhất hiện nay', 'Oto - Cập nhật hình ảnh các mẫu xe mới ra mắt HOT nhất thị trường Việt Nam. Đánh giá xe ô tô, tư vấn chọn ô tô nhiều kiểu dáng, mẫu mã.', 'eee7b957366134410125e7b67231762d', '2018-01-25 02:01:30', '2018-01-25 02:01:30', 'oto - Tin tuc, hinh anh cac mau xe hoi moi nhat hien nay', 'Oto - Cap nhat hinh anh cac mau xe moi ra mat HOT nhat thi truong Viet Nam. danh gia xe o to, tu van chon o to nhieu kieu dang, mau ma.'),
