(98, 'http://www.24h.com.vn/sao-han-c759.html', 'Sao Hàn: Tin nóng, hình ảnh mới nhất về các ngôi sao Hàn Quốc', 'Sao Han - Tin tức Sao Hàn Quốc trong ngày hôm nay. Tin sao Hàn sang Việt Nam cập nhật liên tục. Bộ ảnh những ngôi sao Hàn Quốc xinh đẹp hấp dẫn nhất.', '9de8959598c80465479b72b57eae26b2', '2018-01-25 02:01:37', '2018-01-25 02:01:37', 'Sao Han: Tin nong, hinh anh moi nhat ve cac ngoi sao Han Quoc', 'Sao Han - Tin tuc Sao Han Quoc trong ngay hom nay. Tin sao Han sang Viet Nam cap nhat lien tuc. Bo anh nhung ngoi sao Han Quoc xinh dep hap dan nhat.'),
(99, 'http://www.24h.com.vn/tennis-c119.html', 'Tennis - Tin tức quần vợt, lịch thi đấu, video trực tuyến', 'Tennis 24h - Cập nhật nhanh tin tức Quần vợt mới nhất hôm nay. Xem kết quả, lịch thi đấu, video clip thể thao Tennis trực tuyến Online tại Việt Nam & Thế giới.', '6f784fc660dcd33eeeb64d3901e09424', '2018-01-25 02:01:38', '2018-01-25 02:01:38', 'Tennis - Tin túc quàn vọt, lịch thi dáu, video trục tuyén', 'Tennis 24h - Cạp nhạt nhanh tin túc Quàn vọt mói nhát hom nay. Xem két quả, lịch thi dáu, video clip thẻ thao Tennis trục tuyén Online tại Viẹt Nam & Thé giói.'),
(100, 'http://www.24h.com.vn/vo-thuat-ufc-quyen-anh-c117.html', 'Võ thuật - UFC - quyền Anh: Video hấp dẫn nhất về các môn võ, đấm bốc', 'Tổng hợp video clip võ thuật, UFC, quyền anh hạng nặng. Tin tức, hình ảnh những cuộc so tài đỉnh cao của quyền Anh thế giới.', '13e5a42335c59db83bb65558036457a8', '2018-01-25 02:01:39', '2018-01-25 02:01:39', 'Vo thuat - UFC - quyen Anh: Video hap dan nhat ve cac mon vo, dam boc', 'Tong hop video clip vo thuat, UFC, quyen anh hang nang. Tin tuc, hinh anh nhung cuoc so tai dinh cao cua quyen Anh the gioi.'),
(101, 'http://www.24h.com.vn/clip-dac-sac-c446.html', 'Video thể thao: Cập nhật những video hay nhất trong ngày', 'Video the thao - Tổng hợp những video clip thể thao hấp dẫn 24h qua. Clip các môn thể thao tennis, bơi lội, F1, bi-a, golf đặc sắc nhất.', 'c6ed624f6db0d362244a4359510e6f22', '2018-01-25 02:01:39', '2018-01-25 02:01:39', 'Video the thao: Cap nhat nhung video hay nhat trong ngay', 'Video the thao - Tong hop nhung video clip the thao hap dan 24h qua. Clip cac mon the thao tennis, boi loi, F1, bi-a, golf dac sac nhat.'),
(102, 'http://www.24h.com.vn/lich-thi-dau-the-thao/lich-thi-dau-the-thao-hom-nay-moi-nhat-c386a908602.html', 'Lịch thi đấu thể thao hôm nay mới nhất - Lịch thi đấu thể thao', 'Lich thi dau the thao - Cập nhật chi tiết lịch đấu các môn thể thao hấp dẫn trên toàn thế giới. Lịch thi đấu các môn tennis, bóng rổ, golf... hôm nay. - Lịch thi đấu thể thao', '14d3659c534cbdb8367a5d4e8b4b7988', '2018-01-25 02:01:40', '2018-01-25 02:01:40', 'Lich thi dau the thao hom nay moi nhat - Lich thi dau the thao', 'Lich thi dau the thao - Cap nhat chi tiet lich dau cac mon the thao hap dan tren toan the gioi. Lich thi dau cac mon tennis, bong ro, golf... hom nay. - Lich thi dau the thao'),
(103, 'http://www.24h.com.vn/truc-tiep-tennis-hom-nay-c101e4398.html', 'Trực tiếp tennis hôm nay - Video tennis trực tuyến mới nhất', 'Truc tiep tennis - Tường thuật trực tiếp các trận tennis diễn ra trong ngày. Video tổng hợp highlight những trận tennis hấp dẫn mới nhất.', 'c0a70fa2fc18d2c944eba2473d9a3984', '2018-01-25 02:01:40', '2018-01-25 02:01:40', 'Truc tiep tennis hom nay - Video tennis truc tuyen moi nhat', 'Truc tiep tennis - Tuong thuat truc tiep cac tran tennis dien ra trong ngay. Video tong hop highlight nhung tran tennis hap dan moi nhat.'),
(104, 'http://www.24h.com.vn/phim-c74.html', 'Phim 24H - Top phim hay - Tin tức phim ảnh tuần qua', 'Phim 24H moi nhat - Review phim bộ, phim lẻ hay nhất hiện nay. Trailer những bộ phim điện ảnh bom tấn sắp ra. Lịch chiếu phim mới nhất.', 'bdd1c82b40152ea827fc3cffdc9a1671', '2018-01-25 02:01:41', '2018-01-25 02:01:41', 'Phim 24H - Top phim hay - Tin tuc phim anh tuan qua', 'Phim 24H moi nhat - Review phim bo, phim le hay nhat hien nay. Trailer nhung bo phim dien anh bom tan sap ra. Lich chieu phim moi nhat.'),
(105, 'http://www.24h.com.vn/ca-nhac-mtv-c73.html', 'Ca Nhạc Trẻ MTV 24H - Tin tức ca nhạc hot nhất hiện nay', 'Ca nhạc MTV - Tin tức về âm nhạc , scandal nổi tiếng, sao nội, sao ngoại, các ca khúc hay, bảng xếp hạng âm nhạc được cập nhật liên tục 24h trong ngày', 'b7478eef8ce5216d79bf21ffc65feb21', '2018-01-25 02:01:42', '2018-01-25 02:01:42', 'Ca Nhac Tre MTV 24H - Tin tuc ca nhac hot nhat hien nay', 'Ca nhac MTV - Tin tuc ve am nhac , scandal noi tieng, sao noi, sao ngoai, cac ca khuc hay, bang xep hang am nhac duoc cap nhat lien tuc 24h trong ngay'),
(106, 'http://www.24h.com.vn/tv-show-c761.html', 'TV Shows - Tổng hợp những chương trình truyền hình hay nhất', 'TV Shows - Cập nhật những tập mới nhất của show thực tế đang chiếu trên truyền hình. Video tập mới nhất, hay nhất trong tuần.', 'd42d59b23e1106c026eef36178bc12ef', '2018-01-25 02:01:42', '2018-01-25 02:01:42', 'TV Shows - Tong hop nhung chuong trinh truyen hinh hay nhat', 'TV Shows - Cap nhat nhung tap moi nhat cua show thuc te dang chieu tren truyen hinh. Video tap moi nhat, hay nhat trong tuan.'),
(107, 'http://www.24h.com.vn/lam-chi-khanh-c729e2512.html', 'Đám cưới Lâm Khánh Chi & Trần Phi Hùng: Toàn cảnh diễn ra buổi hôn lễ', 'Lâm Khánh Chi & Trần Phi Hùng gấp rút chuẩn bị cho lễ rước dâu diễn ra ngày 28/12 và đám cưới vào ngày hôm nay 28/12/2018.', '73077c4e790a4d6e5b08317c3469f4e3', '2018-01-25 02:01:43', '2018-01-25 02:01:43', 'dam cuoi Lam Khanh Chi & Tran Phi Hung: Toan canh dien ra buoi hon le', 'Lam Khanh Chi & Tran Phi Hung gap rut chuan bi cho le ruoc dau dien ra ngay 28/12 va dam cuoi vao ngay hom nay 28/12/2018.'),
(108, 'http://www.24h.com.vn/am-thuc-c460.html', 'Ẩm thực Việt Nam - Món Ngon mỗi ngày - Đặc sản ẩm thực TG', 'AM THUC 24H  - Thực đơn Món ngon mỗi ngày đơn giản, ngon miệng, dễ nấu. Bí quyết NẤU ĂN NGON từ nguyên liệu đơn giản. Giới thiệu Ẩm thực bốn phương & đặc sản 3 miền', '1673e516e8ee8d264a31b846c5fd234a', '2018-01-25 02:01:43', '2018-01-25 02:01:43', 'am thuc Viet Nam - Mon Ngon moi ngay - dac san am thuc TG', 'AM THUC 24H  - Thuc don Mon ngon moi ngay don gian, ngon mieng, de nau. Bi quyet NaU aN NGON tu nguyen lieu don gian. Gioi thieu am thuc bon phuong & dac san 3 mien'),
(109, 'http://www.24h.com.vn/an-goi-den-nha-c524t0p0q0.html', 'đặt ăn tại nhà qua điện thoại | đặt mang đồ ăn tới nhà', 'ẩm thực 24h, giúp bạn đặt ăn tới nhà qua điện thoại, trong địa bàn HCM, hà nội, Bấm ngay để điện thoại đặt ăn !', '68f243edc21f7a1a374a717620d9be16', '2018-01-25 02:01:44', '2018-01-25 02:01:44', 'dat an tai nha qua dien thoai | dat mang do an toi nha', 'am thuc 24h, giup ban dat an toi nha qua dien thoai, trong dia ban HCM, ha noi, Bam ngay de dien thoai dat an !'),
(110, 'http://www.24h.com.vn/thuc-don-hang-ngay-c460e4843.html', 'Thực đơn hàng ngày: Chia sẻ các bữa ăn ngon mỗi ngày cho gia đình', 'Thực đơn hàng ngày - Hình ảnh, hướng dẫn cách sắp thực đơn gia đình mỗi ngày ngon, đơn giản và đầy đủ dinh dưỡng. Cách làm các món ăn đơn giản, tiện lợi nhất.', '7967133aca12b5f59fc53082968c8d33', '2018-01-25 02:01:44', '2018-01-25 02:01:44', 'Thuc don hang ngay: Chia se cac bua an ngon moi ngay cho gia dinh', 'Thuc don hang ngay - Hinh anh, huong dan cach sap thuc don gia dinh moi ngay ngon, don gian va day du dinh duong. Cach lam cac mon an don gian, tien loi nhat.'),
(111, 'http://www.24h.com.vn/clip-nau-an-c460e5074.html', 'Video nấu ăn: Hướng dẫn nấu ăn qua clip chi tiết đơn giản nhất', 'Video nau an - Chia sẻ các clip dạy nấu ăn qua từng bước. Với các video ẩm thực này, bạn sẽ không còn thấy nấu nướng là một việc khó khăn nữa.', 'bfd0d3948735bf56ca25e6773f56a4e3', '2018-01-25 02:01:45', '2018-01-25 02:01:45', 'Video nau an: Huong dan nau an qua clip chi tiet don gian nhat', 'Video nau an - Chia se cac clip day nau an qua tung buoc. Voi cac video am thuc nay, ban se khong con thay nau nuong la mot viec kho khan nua.'),
(112, 'http://www.24h.com.vn/mon-ngon-moi-ngay-c460e2552.html', 'Món Ngon Mỗi Ngày, Dạy nấu những món ăn tuyệt vời nhất', 'Món ngon mỗi ngày dễ làm  - Thực đơn các MÓN NGON mỗi ngày đơn giản và ngon rẻ tiết kiệm nhất dành cho mỗi gia đình. Bí quyết nấu Mon ngon moi ngay tại 24H', '91272d15fdac6d3d90e8304de4fcca76', '2018-01-25 02:01:45', '2018-01-25 02:01:45', 'Mon Ngon Moi Ngay, Day nau nhung mon an tuyet voi nhat', 'Mon ngon moi ngay de lam  - Thuc don cac MoN NGON moi ngay don gian va ngon re tiet kiem nhat danh cho moi gia dinh. Bi quyet nau Mon ngon moi ngay tai 24H'),
(113, 'http://www.24h.com.vn/du-lich-24h-c76.html', 'Du Lịch - Địa điểm dã ngoại, tour VN thế giới giá rẻ', 'Du lich - Hình ảnh các địa điểm du lịch giá rẻ nổi tiếng Việt Nam & thế giới. Tư vấn các tour du lịch khám phá cảnh đẹp, những món ngon… cực hấp dẫn.', 'ae245fe8b34b81020c18de77b5a307ce', '2018-01-25 02:01:45', '2018-01-25 02:01:45', 'Du Lich - dia diem da ngoai, tour VN the gioi gia re', 'Du lich - Hinh anh cac dia diem du lich gia re noi tieng Viet Nam & the gioi. Tu van cac tour du lich kham pha canh dep, nhung mon ngon… cuc hap dan.'),
(114, 'http://www.24h.com.vn/du-lich-viet-nam-c501.html', 'Du lịch Việt Nam: Khám phá địa danh, thắng cảnh đẹp mọi miền tổ quốc', 'Du lịch Việt Nam - Cùng 24h khám phá cảnh đẹp đất nước, con người VN thân thiện. Những địa điểm du lịch Việt Nam huyền bí đầy mê hoặc không thể bỏ qua.', '42cf88bbdae0ffd45ff96f838ab7d469', '2018-01-25 02:01:46', '2018-01-25 02:01:46', 'Du lich Viet Nam: Kham pha dia danh, thang canh dep moi mien to quoc', 'Du lich Viet Nam - Cung 24h kham pha canh dep dat nuoc, con nguoi VN than thien. Nhung dia diem du lich Viet Nam huyen bi day me hoac khong the bo qua.'),
(115, 'http://www.24h.com.vn/diem-du-lich-c82.html', 'Những địa điểm du lịch Việt Nam và Thế Giới hấp dẫn nhất', 'Địa điểm du lịch - Khám phá top những kỳ quan cảnh đẹp nổi tiếng, Các địa điểm du lịch hấp dẫn nhất hành tinh trên Thế Giới và Việt Nam.', '171a34bc5f7ed73d29668ea4fc612c21', '2018-01-25 02:01:47', '2018-01-25 02:01:47', 'Nhung dia diem du lich Viet Nam va The Gioi hap dan nhat', 'dia diem du lich - Kham pha top nhung ky quan canh dep noi tieng, Cac dia diem du lich hap dan nhat hanh tinh tren The Gioi va Viet Nam.'),
(116, 'http://www.24h.com.vn/tin-tuc-du-lich-c682.html', 'Tin du lịch - Tin tức du lịch Việt Nam, Thế giới mới nhất', 'Tin tuc du lich 24H - Tổng hợp tin về các danh lam thắng cảnh, những địa điểm du lịch Việt Nam và quốc tế, tour du lịch giá rẻ hấp dẫn.', 'e92c2b69e4640620b2d4f33bb9e13c38', '2018-01-25 02:01:47', '2018-01-25 02:01:47', 'Tin du lich - Tin tuc du lich Viet Nam, The gioi moi nhat', 'Tin tuc du lich 24H - Tong hop tin ve cac danh lam thang canh, nhung dia diem du lich Viet Nam va quoc te, tour du lich gia re hap dan.'),
(117, 'http://www.24h.com.vn/kham-pha-du-lich-trung-quoc-c76e3322.html', 'Du lich Trung Quoc 2017: Địa điểm du lịch đẹp Trung Hoa có 102', 'Du lich Trung Quoc 2017 - Khám phá địa điểm du lịch Trung Quốc, Bắc Kinh, Thượng Hải, Hồng Kông... Kinh nghiệm du lịch trung quốc', '3b9d3d5d8624a45074124b9ebe5a212c', '2018-01-25 02:01:48', '2018-01-25 02:01:48', 'Du lich Trung Quoc 2017: dia diem du lich dep Trung Hoa co 102', 'Du lich Trung Quoc 2017 - Kham pha dia diem du lich Trung Quoc, Bac Kinh, Thuong Hai, Hong Kong... Kinh nghiem du lich trung quoc'),
(118, 'http://www.24h.com.vn/giao-duc-du-hoc-c216.html', 'Giao Duc Du Hoc - Thông tin tuyển sinh giáo dục VN', 'Giáo dục du học - Thông tin tuyển sinh đại học cao đẳng. Tin tức giáo dục, báo giáo dục, các luật giáo dục mới được áp dụng cho giáo dục Việt Nam', 'a47d9ea29a0144ad3a81dc2f03540d29', '2018-01-25 02:01:48', '2018-01-25 02:01:48', 'Giao Duc Du Hoc - Thong tin tuyen sinh giao duc VN', 'Giao duc du hoc - Thong tin tuyen sinh dai hoc cao dang. Tin tuc giao duc, bao giao duc, cac luat giao duc moi duoc ap dung cho giao duc Viet Nam'),
(119, 'http://www.24h.com.vn/day-con-c216e4914.html', 'Dạy con: Hướng dẫn cách dạy con ngoan, bí quyết dạy con nên người', 'Chia sẻ các cách dạy con hay, thành công đã được kiểm chứng. Phương pháp dạy bảo, rèn luyện cho con trẻ hợp lý và khoa học nhất.', '6ac16d1df815e197d5e4890a388bd93c', '2018-01-25 02:01:49', '2018-01-25 02:01:49', 'Day con: Huong dan cach day con ngoan, bi quyet day con nen nguoi', 'Chia se cac cach day con hay, thanh cong da duoc kiem chung. Phuong phap day bao, ren luyen cho con tre hop ly va khoa hoc nhat.'),
(120, 'http://www.24h.com.vn/du-hoc-c261.html', 'DU HOC 2015 : Học Bổng & Tư vấn Du học tự túc 2015', 'DU HOC 20154 -  Thông tin học bổng du học toàn phần các nước Mỹ, Úc, Singapore. Tư vấn Du Học tự túc chọn trường từ các công ty du học uy tín', '17b81ee35081f3a83d2da78d94c98747', '2018-01-25 02:01:49', '2018-01-25 02:01:49', 'DU HOC 2015 : Hoc Bong & Tu van Du hoc tu tuc 2015', 'DU HOC 20154 -  Thong tin hoc bong du hoc toan phan cac nuoc My, uc, Singapore. Tu van Du Hoc tu tuc chon truong tu cac cong ty du hoc uy tin'),
(121, 'http://www.24h.com.vn/nhung-than-dong-noi-tieng-tg-c216e4899.html', 'Những thần đồng - thiên tài nổi tiếng thế giới', 'Chia sẻ câu chuyện về những thần đồng, thiên tài nổi tiếng. Liệu những thần đồng nổi tiếng có thực sự thành công khi trưởng thành?', '31a88c729adbaf6ffe862336714610d7', '2018-01-25 02:01:50', '2018-01-25 02:01:50', 'Nhung than dong - thien tai noi tieng the gioi', 'Chia se cau chuyen ve nhung than dong, thien tai noi tieng. Lieu nhung than dong noi tieng co thuc su thanh cong khi truong thanh?'),
(122, 'http://www.24h.com.vn/giao-duc-c216e4636.html', 'Giáo dục: Tin tức giáo dục, tin tuyển sinh, du học mới nhất - 24h', 'Giao duc - Cập nhật tình hình thông tin giáo dục, tuyển sinh, du học liên tục trong 24h qua', '28f3bce33f5d10b0b74e652af319eacf', '2018-01-25 02:01:50', '2018-01-25 02:01:50', 'Giao duc: Tin tuc giao duc, tin tuyen sinh, du hoc moi nhat - 24h', 'Giao duc - Cap nhat tinh hinh thong tin giao duc, tuyen sinh, du hoc lien tuc trong 24h qua'),
(123, 'http://www.24h.com.vn/khoa-nhi-c254.html', 'Benh tre em | Chuyên trang chăm sóc sức khỏe MẸ & BÉ', 'Benh tre em - Chia sẻ bí quyết chăm sóc sức khỏe TRẺ EM. Các bệnh thường gặp ở trẻ nhỏ. Biến pháp trị bệnh cho bé. Phòng tránh các bệnh TAI - MŨI - HỌNG', 'ea04d0e2d8b59beac6dc99522ca667ef', '2018-01-25 02:01:51', '2018-01-25 02:01:51', 'Benh tre em | Chuyen trang cham soc suc khoe Me & Be', 'Benh tre em - Chia se bi quyet cham soc suc khoe TRe EM. Cac benh thuong gap o tre nho. Bien phap tri benh cho be. Phong tranh cac benh TAI - MuI - HoNG'),
