(125, 'http://www.24h.com.vn/benh-dan-ong-c778.html', 'Bệnh đàn ông - Chuyên trang về sức khỏe nam giới 24h', 'Tư vấn chữa những bệnh của nam giới thường gặp. Cách điều trị bệnh nam giới như yếu sinh lý, xuất tinh sớm đơn giản hiệu nghiệm,', 'a21f3ed28c0e6538c568d35a7aa33493', '2018-01-25 02:01:52', '2018-01-25 02:01:52', 'Benh dan ong - Chuyen trang ve suc khoe nam gioi 24h', 'Tu van chua nhung benh cua nam gioi thuong gap. Cach dieu tri benh nam gioi nhu yeu sinh ly, xuat tinh som don gian hieu nghiem,'),
(126, 'http://www.24h.com.vn/benh-phu-nu-c779.html', 'Bệnh phụ nữ - Chuyên trang tư vấn, chia sẻ về bệnh chị em hay gặp', 'Benh phu nu - Cách điều trị những bệnh phụ khoa, bệnh của chị em có hiệu quả nhất. Chia sẻ về những căn bệnh khó nói, bệnh hiếm gặp ở phụ nữ.', '65316a01adf38fdcdd879432768b7187', '2018-01-25 02:01:52', '2018-01-25 02:01:52', 'Benh phu nu - Chuyen trang tu van, chia se ve benh chi em hay gap', 'Benh phu nu - Cach dieu tri nhung benh phu khoa, benh cua chi em co hieu qua nhat. Chia se ve nhung can benh kho noi, benh hiem gap o phu nu.'),
(127, 'http://www.24h.com.vn/bai-thuoc-dan-gian-c67.html', 'Bài thuốc dân gian: Tổng hợp những bài thuốc dân gian hay và hiệu quả nhất', 'Bai thuoc dan gian - Tuyển tập những bài thuốc quý từ dân gian đặc trị các bệnh thường gặp. Sống khỏe mỗi ngày với Suc khoe 24h', '38255020e89034b938cff2e9b0a6172f', '2018-01-25 02:01:53', '2018-01-25 02:01:53', 'Bai thuoc dan gian: Tong hop nhung bai thuoc dan gian hay va hieu qua nhat', 'Bai thuoc dan gian - Tuyen tap nhung bai thuoc quy tu dan gian dac tri cac benh thuong gap. Song khoe moi ngay voi Suc khoe 24h'),
