(163, 'http://fica.vn/tai-chinh-thong-minh/tinh-gdp-chinh-thuc-hay-khong-chinh-thuc-36435.html', 'Tính GDP chính thức hay không chính thức?-Tài chính thông minh - Cổng thông tin kinh tế - tài chính Việt Nam và thế giới', 'Thực ra, tôi đồng tình với việc thay đổi phương pháp tính GDP, mở rộng thêm cả khu vực kinh tế không chính thức.', '3dc4dab2e85d4f187b014d0b4b253b48', '2018-01-25 02:02:33', '2018-01-25 02:02:33', 'Tinh GDP chinh thuc hay khong chinh thuc?-Tai chinh thong minh - Cong thong tin kinh te - tai chinh Viet Nam va the gioi', 'Thuc ra, toi dong tinh voi viec thay doi phuong phap tinh GDP, mo rong them ca khu vuc kinh te khong chinh thuc.'),
(164, 'http://fica.vn/tai-chinh-thong-minh/cua-nao-cho-o-to-lap-rap-canh-tranh-voi-xe-nhap-khau-nguyen-chiec-36390.html', 'Cửa nào cho ô tô lắp ráp cạnh tranh với xe nhập khẩu nguyên chiếc-Tài chính thông minh - Cổng thông tin kinh tế - tài chính Việt Nam và thế giới', 'Năm 2017 là một năm nhiều khó khăn đối với các hãng xe khi nhu cầu thị trường có sự biến động so với giai đoạn tăng trưởng ổn định trước đó từ năm 2013 – 2016. Nguyên nhân chủ yếu bắt nguồn từ tâm lý chờ đợi của khách hàng về viễn cảnh thị trường năm 2018. ', 'a0fe58dab2b73bb121b5e3b79032b298', '2018-01-25 02:02:34', '2018-01-25 02:02:34', 'Cua nao cho o to lap rap canh tranh voi xe nhap khau nguyen chiec-Tai chinh thong minh - Cong thong tin kinh te - tai chinh Viet Nam va the gioi', 'Nam 2017 la mot nam nhieu kho khan doi voi cac hang xe khi nhu cau thi truong co su bien dong so voi giai doan tang truong on dinh truoc do tu nam 2013 – 2016. Nguyen nhan chu yeu bat nguon tu tam ly cho doi cua khach hang ve vien canh thi truong nam 2018. '),
(165, 'http://fica.vn/tai-chinh-thong-minh/toi-ung-ho-phuong-phap-tinh-gdp--36353.html', 'Tôi ủng hộ phương pháp tính GDP -Tài chính thông minh - Cổng thông tin kinh tế - tài chính Việt Nam và thế giới', 'Tôi đồng tình với việc thay đổi phương pháp tính GDP, mở rộng thêm cả khu vực kinh tế không chính thức. ', '9b19cdd9443e1c6afa26f6283dd9e1d0', '2018-01-25 02:02:34', '2018-01-25 02:02:34', 'Toi ung ho phuong phap tinh GDP -Tai chinh thong minh - Cong thong tin kinh te - tai chinh Viet Nam va the gioi', 'Toi dong tinh voi viec thay doi phuong phap tinh GDP, mo rong them ca khu vuc kinh te khong chinh thuc. '),
(166, 'http://fica.vn/tai-chinh-thong-minh/day-lui-tham-nhung-lang-phi-danh-trong-phai-danh-lien-hoi-36227.html', 'Đẩy lùi tham nhũng, lãng phí: Đánh trống phải đánh liên hồi-Tài chính thông minh - Cổng thông tin kinh tế - tài chính Việt Nam và thế giới', 'Nút thắt lớn nhất hiện nay của nền kinh tế hiện nay là tham nhũng, lãng phí, thất thoát. Khi nào những hiện tượng này còn tồn tại thì nền kinh tế còn bị cản trở, bó hẹp, không phát triển được.', '489046613bd7a7e1a8cbd70b7400546d', '2018-01-25 02:02:35', '2018-01-25 02:02:35', 'day lui tham nhung, lang phi: danh trong phai danh lien hoi-Tai chinh thong minh - Cong thong tin kinh te - tai chinh Viet Nam va the gioi', 'Nut that lon nhat hien nay cua nen kinh te hien nay la tham nhung, lang phi, that thoat. Khi nao nhung hien tuong nay con ton tai thi nen kinh te con bi can tro, bo hep, khong phat trien duoc.'),
(167, 'http://fica.vn/tai-chinh-thong-minh/dam-bao-su-ton-tai-ben-vung-cua-nganh-thuy-hai-san-36132.html', 'Đảm bảo sự tồn tại bền vững của ngành thủy hải sản-Tài chính thông minh - Cổng thông tin kinh tế - tài chính Việt Nam và thế giới', 'Vừa mới nhậm chức tại Việt Nam, ngài Dan Kritenbrink, Đại sứ  Hợp chủng quốc Hoa Kỳ tại Việt Nam đã có một bài viết gửi Dân trí về việc đảm bảo sự tồn tại bền vững trong lĩnh vực thủy hải sản. Dân trí xin trân trọng giới thiệu cùng bạn đọc: ', '00e024c253f8369be7079bd65d73522d', '2018-01-25 02:02:35', '2018-01-25 02:02:35', 'dam bao su ton tai ben vung cua nganh thuy hai san-Tai chinh thong minh - Cong thong tin kinh te - tai chinh Viet Nam va the gioi', 'Vua moi nham chuc tai Viet Nam, ngai Dan Kritenbrink, dai su  Hop chung quoc Hoa Ky tai Viet Nam da co mot bai viet gui Dan tri ve viec dam bao su ton tai ben vung trong linh vuc thuy hai san. Dan tri xin tran trong gioi thieu cung ban doc: '),
(168, 'http://fica.vn/quoc-te/bitcoin-co-the-mat-90-gia-tri-36445.html', 'Bitcoin có thể mất 90% giá trị-Quốc tế - Cổng thông tin kinh tế - tài chính Việt Nam và thế giới', 'Peter Boockvar, nhà đầu tư kì cựu của Phố Wall, đã dự đoán một vụ trượt giá thảm hại sắp xảy ra trên thị trường tiền ảo.', '62690bd87d09589d1a65256207820ce3', '2018-01-25 02:02:35', '2018-01-25 02:02:35', 'Bitcoin co the mat 90% gia tri-Quoc te - Cong thong tin kinh te - tai chinh Viet Nam va the gioi', 'Peter Boockvar, nha dau tu ki cuu cua Pho Wall, da du doan mot vu truot gia tham hai sap xay ra tren thi truong tien ao.'),
